class MD4:
    """MD4 implementation for NTLM hashing"""
    width = 32
    mask = 0xFFFFFFFF
    h = [0x67452301, 0xEFCDAB89, 0x98BADCFE, 0x10325476]

    def __init__(self, msg: bytes = b""):
        self.msg = msg
        # Pre-processing
        ml = len(msg) * 8
        msg += b"\x80"
        msg += b"\x00" * (-(len(msg) + 8) % 64)
        msg += struct.pack("<Q", ml)
        
        # Process chunks
        self._process([msg[i:i + 64] for i in range(0, len(msg), 64)])

    def hexdigest(self) -> str:
        return "".join(f"{value:02x}" for value in struct.pack("<4L", *self.h))

    def _process(self, chunks):
        for chunk in chunks:
            X, h = list(struct.unpack("<16I", chunk)), self.h.copy()
            
            # Round 1
            Xi = [3, 7, 11, 19]
            for n in range(16):
                i, j, k, l = map(lambda x: x % 4, range(-n, -n + 4))
                K, S = n, Xi[n % 4]
                hn = h[i] + self._F(h[j], h[k], h[l]) + X[K]
                h[i] = self._lrot(hn & self.mask, S)
            
            # Round 2
            Xi = [3, 5, 9, 13]
            for n in range(16):
                i, j, k, l = map(lambda x: x % 4, range(-n, -n + 4))
                K, S = n % 4 * 4 + n // 4, Xi[n % 4]
                hn = h[i] + self._G(h[j], h[k], h[l]) + X[K] + 0x5A827999
                h[i] = self._lrot(hn & self.mask, S)
            
            # Round 3
            Xi = [3, 9, 11, 15]
            Ki = [0, 8, 4, 12, 2, 10, 6, 14, 1, 9, 5, 13, 3, 11, 7, 15]
            for n in range(16):
                i, j, k, l = map(lambda x: x % 4, range(-n, -n + 4))
                K, S = Ki[n], Xi[n % 4]
                hn = h[i] + self._H(h[j], h[k], h[l]) + X[K] + 0x6ED9EBA1
                h[i] = self._lrot(hn & self.mask, S)
            
            self.h = [((v + n) & self.mask) for v, n in zip(self.h, h)]

    @staticmethod
    def _F(x, y, z): return (x & y) | (~x & z)
    
    @staticmethod
    def _G(x, y, z): return (x & y) | (x & z) | (y & z)
    
    @staticmethod
    def _H(x, y, z): return x ^ y ^ z
    
    @staticmethod
    def _lrot(value, n):
        return ((value << n) & MD4.mask) | (value >> (MD4.width - n))

class EmailGenerator:
    """Generates realistic email addresses with weighted patterns"""
    
    def __init__(self, first_names, surnames, domains, nicknames=None):
        self.first_names = first_names
        self.surnames = surnames
        self.domains = domains
        self.nicknames = nicknames or ["ace", "buddy", "chief", "duke", "flash", "hawk", "king", "max", "neo", "spike"]
        
        # Popular email domains by type
        self.personal_domains = ["gmail.com", "yahoo.com", "hotmail.com", "outlook.com", "icloud.com"]
        self.business_domains = ["company.com", "corporate.net", "business.org", "enterprise.com"]
        
        # Build weighted pattern selection
        self.patterns = []
        self.weights = []
        
        pattern_map = {
            'firstname.surname': self._pattern_firstname_dot_surname,
            'firstname_surname': self._pattern_firstname_underscore_surname,
            'firstnamesurname': self._pattern_firstname_surname,
            'firstname.numbers': self._pattern_firstname_numbers,
            'random_professional': self._pattern_professional,
            'nickname': self._pattern_nickname,
            'firstname_year': self._pattern_firstname_year,
            'complex': self._pattern_complex
        }
        
        for pattern_name, weight in Config.EMAIL_PATTERN_WEIGHTS.items():
            if pattern_name in pattern_map:
                self.patterns.append(pattern_map[pattern_name])
                self.weights.append(weight)
    
    def generate(self) -> str:
        """Generate a realistic email using weighted patterns"""
        pattern = random.choices(self.patterns, weights=self.weights)[0]
        return pattern()
    
    def _get_birth_year(self) -> str:
        """Generate realistic birth year (1960-2005)"""
        year = random.randint(1960, 2005)
        if random.random() < 0.5:
            return str(year)
        else:
            return str(year)[2:]  # Just last 2 digits
    
    def _pattern_firstname_dot_surname(self) -> str:
        domain = random.choice(self.personal_domains)
        return f"{random.choice(self.first_names).lower()}.{random.choice(self.surnames).lower()}@{domain}"
    
    def _pattern_firstname_underscore_surname(self) -> str:
        domain = random.choice(self.domains)
        return f"{random.choice(self.first_names).lower()}_{random.choice(self.surnames).lower()}@{domain}"
    
    def _pattern_firstname_surname(self) -> str:
        domain = random.choice(self.personal_domains)
        return f"{random.choice(self.first_names).lower()}{random.choice(self.surnames).lower()}@{domain}"
    
    def _pattern_firstname_numbers(self) -> str:
        numbers = random.randint(1, 999)
        domain = random.choice(self.domains)
        return f"{random.choice(self.first_names).lower()}.{numbers}@{domain}"
    
    def _pattern_professional(self) -> str:
        first = random.choice(self.first_names).lower()
        last = random.choice(self.surnames).lower()
        domain = random.choice(self.business_domains)
        
        patterns = [
            f"{first[0]}{last}@{domain}",
            f"{first}.{last}@{domain}",
            f"{last}.{first}@{domain}",
            f"{first}@{domain}"
        ]
        return random.choice(patterns)
    
    def _pattern_nickname(self) -> str:
        nickname = random.choice(self.nicknames)
        numbers = random.randint(1, 99) if random.random() < 0.5 else ""
        domain = random.choice(self.personal_domains)
        return f"{nickname}{numbers}@{domain}"
    
    def _pattern_firstname_year(self) -> str:
        first = random.choice(self.first_names).lower()
        year = self._get_birth_year()
        domain = random.choice(self.personal_domains)
        
        patterns = [
            f"{first}{year}@{domain}",
            f"{first}.{year}@{domain}",
            f"{first}_{year}@{domain}"
        ]
        return random.choice(patterns)
    
    def _pattern_complex(self) -> str:
        """Complex patterns that look like they were auto-generated"""
        chars = string.ascii_lowercase + string.digits + '._-'
        length = random.randint(8, 15)
        username = ''.join(random.choices(chars, k=length))
        domain = random.choice(self.domains)
        return f"{username}@{domain}"

class PasswordGenerator:
    """Generates realistic passwords with common patterns"""
    
    def __init__(self, common_passwords, common_words=None):
        self.common_passwords = common_passwords
        self.common_words = common_words or ["love", "blue", "star", "fire", "cool", "super", "mega", "power"]
        self.special_chars = "!@#$%^&*"
        
    def generate(self) -> str:
        """Generate a realistic password"""
        rand = random.random()
        
        if rand < Config.COMMON_PASSWORD_PROBABILITY:
            # Use common password, possibly with modifications
            password = random.choice(self.common_passwords)
            
            # Sometimes add year or numbers
            if random.random() < 0.3:
                year = random.randint(1980, 2024)
                password += str(year)
            elif random.random() < 0.2:
                password += str(random.randint(1, 99))
            
            # Sometimes add special char
            if random.random() < 0.1:
                password += random.choice(self.special_chars)
                
            return password
        
        elif rand < Config.COMMON_PASSWORD_PROBABILITY + 0.3:
            # Word + number pattern
            word = random.choice(self.common_words).capitalize()
            number = random.randint(1, 9999)
            
            patterns = [
                f"{word}{number}",
                f"{word.lower()}{number}",
                f"{word}{number}!",
                f"{number}{word}",
            ]
            return random.choice(patterns)
        
        else:
            # Random password
            length = random.randint(Config.MIN_PASSWORD_LENGTH, Config.MAX_PASSWORD_LENGTH)
            
            # Decide character set
            chars = string.ascii_letters + string.digits
            if random.random() < Config.SPECIAL_CHAR_PROBABILITY:
                chars += self.special_chars
            
            password = ''.join(random.choices(chars, k=length))
            
            # Ensure mix of upper/lower for longer passwords
            if length > 8 and password.isalpha():
                password = password[:length//2].lower() + password[length//2:].upper()
            
            return password

class HashGenerator:
    """Handles all hash generation logic"""
    
    def __init__(self):
        self.bcrypt_available = False
        self.scrypt_available = False
        self.argon2_available = False
        
        # Check for optional libraries
        try:
            import bcrypt
            self.bcrypt = bcrypt
            self.bcrypt_available = True
        except ImportError:
            pass
        
        try:
            import scrypt as scrypt_lib
            self.scrypt_lib = scrypt_lib
            self.scrypt_available = True
        except ImportError:
            pass
        
        try:
            from argon2 import PasswordHasher
            self.argon2_hasher = PasswordHasher()
            self.argon2_available = True
        except ImportError:
            pass
    
    @staticmethod
    def generate_salt() -> str:
        """Generate a random salt"""
        length = random.randint(Config.SALT_MIN_LENGTH, Config.SALT_MAX_LENGTH)
        return ''.join(random.choices(string.ascii_letters + string.digits, k=length))
    
    @staticmethod
    def hash_md5(data: str) -> str:
        return hashlib.md5(data.encode('utf-8')).hexdigest()
    
    @staticmethod
    def hash_sha1(data: str) -> str:
        return hashlib.sha1(data.encode('utf-8')).hexdigest()
    
    @staticmethod
    def hash_sha256(data: str) -> str:
        return hashlib.sha256(data.encode('utf-8')).hexdigest()
    
    @staticmethod
    def hash_sha512(data: str) -> str:
        return hashlib.sha512(data.encode('utf-8')).hexdigest()
    
    @staticmethod
    def hash_ntlm(data: str) -> str:
        return MD4(data.encode('utf-16le')).hexdigest()
    
    def hash_bcrypt(self, data: str) -> str:
        if not self.bcrypt_available:
            return "bcrypt_not_available"
        # Use a low cost factor for speed in test data generation
        return self.bcrypt.hashpw(data.encode('utf-8'), self.bcrypt.gensalt(rounds=4)).decode('utf-8')
    
    def hash_scrypt(self, data: str) -> str:
        if not self.scrypt_available:
            return "scrypt_not_available"
        # Use minimal parameters for speed
        return self.scrypt_lib.hash(data.encode('utf-8'), salt=b'salt', N=1024, r=1, p=1, buflen=32).hex()
    
    def hash_argon2(self, data: str) -> str:
        if not self.argon2_available:
            return "argon2_not_available"
        return self.argon2_hasher.hash(data)

